import React from "react";
import { BrowserRouter, Switch, Route, Link } from "react-router-dom";

function Navbar() {
  return (
    <div>
      <div className="NavMenuContainer">
        <Link to="/" className="NavLinkHome">
          Home
        </Link>
        <Link to="/create" className="NavLinkCreate">
          Create
        </Link>
        <Link to="/register" className="NavLinkRegister">
          Register
        </Link>
        <Link to="/login" className="NavLinkLogin">
          Login
        </Link>
      </div>
    </div>
  );
}

export default Navbar;
